    false,nt"url": null,nt"notes": "NODC Accession 0119156 contains raw underway
    meteorological, navigational, physical, profile and time series data logged by the
    Scientific Computer System (SCS) aboard NOAA Ship Hi'ialakai in the North Pacific
    Ocean and Philippine Sea from 2014-03-05 to 2014-06-02. Office of Marine and Aviation
    Operations (OMAO) personnel aboard the ship submitted these data and associated
    metadata to NODC. In addition, NODC Accession 0119156 contains supplementary cruise-level
    metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
    and NODC personnel developed the automated process to archive these data under the
    auspices of the NOAA Rolling Deck to Repository (NOAA R2R) program.",nt"owner_org":
